  [],\n\t\"num_tags\": 0,\n\t\"name\": \"oceanographic-profile-data-using-bottle-collected-during-calcofi-cruises-north-pacific-ocean-20\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Bottle data collected during CalCOFI cruises
  1203, 1207, 1210, and 1301, March 2012 - January 2013. The California Cooperative
  Oceanic Fisheries Investigations (CalCOFI) are a unique partnership of the California
  Department of Fish & Wildlife, NOAA Fisheries Service and Scripps Institution of
  Oceanography. The organization was formed in 1949 to study the ecological aspects
  of the sardine population collapse off California. Today our focus has shifted to
  the study of the marine environment off the coast of California, the management
  of its living resources, and monitoring the indicators of El Nino and climate change.
  CalCOFI conducts quarterly cruises off southern & central California, collecting
  a suite of hydrographic and biological data on station and underway.\",\n\t\"owner_org\":
